import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  const screenshots = [];
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the search bar and enter a location
    await page.waitForSelector('#locationInput', { timeout: 5000 });
    await page.fill('#locationInput', 'Seoul');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_filled_location.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_filled_location.png'));

    // Set check-in and check-out dates (use today + 3 and today + 6)
    const today = new Date();
    const checkin = new Date(today);
    checkin.setDate(today.getDate() + 3);
    const checkout = new Date(today);
    checkout.setDate(today.getDate() + 6);

    function formatDate(d) {
      return d.toISOString().split('T')[0];
    }

    await page.fill('#checkinInput', formatDate(checkin));
    await page.fill('#checkoutInput', formatDate(checkout));
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_filled_dates.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_filled_dates.png'));

    // Open the guest menu and add 2 adults, 1 child
    await page.click('.guest-selector');
    await page.waitForSelector('#guestMenu.active', { timeout: 2000 });

    // Increase adults to 2
    for (let i = 0; i < 2; i++) {
      await page.click('xpath=//div[@id="guestMenu"]//div[contains(@class,"guest-option")][1]//button[2]');
    }
    // Increase children to 1
    await page.click('xpath=//div[@id="guestMenu"]//div[contains(@class,"guest-option")][2]//button[2]');

    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_guests_selected.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_guests_selected.png'));

    // Close guest menu by clicking outside
    await page.click('body', { position: { x: 5, y: 5 } });

    // Click search button
    await page.click('.search-btn');
    // Wait for loading spinner to appear and disappear
    await page.waitForSelector('#loading', { state: 'visible', timeout: 2000 });
    await page.waitForSelector('#loading', { state: 'hidden', timeout: 5000 });

    // Screenshot after search
    await page.screenshot({ path: path.join(screenshotsDir, 'step_5_after_search.png') });
    screenshots.push(path.join(screenshotsDir, 'step_5_after_search.png'));

    // Apply filter: click "City"
    await page.click('button.filter-btn:has-text("City")');
    await page.waitForTimeout(800); // Wait for filter to apply

    await page.screenshot({ path: path.join(screenshotsDir, 'step_6_city_filter.png') });
    screenshots.push(path.join(screenshotsDir, 'step_6_city_filter.png'));

    // Wait for at least one listing card to appear
    await page.waitForSelector('.listing-card', { timeout: 3000 });

    // Extract the first 3 listing titles and locations
    const listings = await page.$$eval('.listing-card', cards =>
      cards.slice(0, 3).map(card => {
        const title = card.querySelector('.listing-location')?.textContent?.trim() || '';
        const host = card.querySelector('.listing-host')?.textContent?.trim() || '';
        const price = card.querySelector('.listing-price .amount')?.textContent?.trim() || '';
        return { title, host, price };
      })
    );

    // Click the first listing to open its modal
    const firstListing = await page.$('.listing-card');
    if (firstListing) {
      await firstListing.click();
      // Wait for modal to appear
      await page.waitForSelector('.modal-overlay', { timeout: 3000 });
      await page.screenshot({ path: path.join(screenshotsDir, 'step_7_listing_modal.png') });
      screenshots.push(path.join(screenshotsDir, 'step_7_listing_modal.png'));

      // Extract modal title and price
      const modalTitle = await page.$eval('.modal-content h1', el => el.textContent.trim());
      const modalPrice = await page.$eval('.modal-content .price-amount', el => el.textContent.trim());

      // Close modal
      await page.click('.modal-close');
      await page.waitForSelector('.modal-overlay', { state: 'detached', timeout: 2000 });

      return {
        success: true,
        action: "Performed Airbnb-like search, filtered by city, selected guests/dates, and opened a listing modal.",
        extractedData: {
          listings,
          modal: { modalTitle, modalPrice }
        },
        screenshots,
        error: null
      };
    } else {
      return {
        success: false,
        action: "No listing card found after search/filter.",
        extractedData: {},
        screenshots,
        error: "No listing card found"
      };
    }
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots,
      error: error.message
    };
  }
}

import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  const screenshots = [];
  try {
    // 1. Navigate to the HTML file and wait for network to be idle
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // 2. Take initial screenshot of the loaded homepage
    const step1 = path.join(screenshotsDir, 'step_1_initial.png');
    await page.screenshot({ path: step1 });
    screenshots.push(step1);

    // 3. Wait for the search bar by label text (using label:has-text)
    await page.waitForSelector('label:has-text("Where")');
    // 4. Type "Seoul" in the location input using label+input relationship
    const whereInput = await page.locator('label:has-text("Where")').locator('xpath=following-sibling::input[1]');
    await whereInput.fill('Seoul');
    await page.waitForTimeout(300); // Let UI update

    // 5. Set check-in and check-out dates using label-based selectors
    const checkinInput = await page.locator('label:has-text("Check in")').locator('xpath=following-sibling::input[1]');
    const checkoutInput = await page.locator('label:has-text("Check out")').locator('xpath=following-sibling::input[1]');
    // Pick dates: today + 3 and today + 6
    const today = new Date();
    const checkinDate = new Date(today); checkinDate.setDate(today.getDate() + 3);
    const checkoutDate = new Date(today); checkoutDate.setDate(today.getDate() + 6);
    const fmt = d => d.toISOString().split('T')[0];
    await checkinInput.fill(fmt(checkinDate));
    await checkoutInput.fill(fmt(checkoutDate));
    await page.waitForTimeout(200);

    // 6. Open guest selector using button text (button:has-text)
    const guestBtn = page.locator('button.guest-selector');
    await guestBtn.click();
    await page.waitForSelector('#guestMenu.guest-menu.active');

    // 7. Increase adults to 2 using the "Adults" label and its sibling buttons
    const adultsSection = page.locator('div.guest-option:has(strong:text("Adults"))');
    const adultsPlusBtn = adultsSection.locator('button', { hasText: '+' });
    await adultsPlusBtn.click();
    await adultsPlusBtn.click(); // Set to 2 adults

    // 8. Increase children to 1
    const childrenSection = page.locator('div.guest-option:has(strong:text("Children"))');
    const childrenPlusBtn = childrenSection.locator('button', { hasText: '+' });
    await childrenPlusBtn.click();

    // 9. Take screenshot after filling search form
    const step2 = path.join(screenshotsDir, 'step_2_search_filled.png');
    await page.screenshot({ path: step2 });
    screenshots.push(step2);

    // 10. Click the search button (using aria-label or icon)
    const searchBtn = page.locator('button.search-btn');
    await searchBtn.click();

    // 11. Wait for loading spinner to appear and disappear
    await page.waitForSelector('#loading', { state: 'visible', timeout: 3000 });
    await page.waitForSelector('#loading', { state: 'hidden', timeout: 7000 });

    // 12. Wait for listings grid to update (at least one listing with Seoul in location)
    await page.waitForSelector('.listings-grid .listing-card:has(.listing-location:has-text("Seoul"))', { timeout: 5000 });

    // 13. Take screenshot of search results
    const step3 = path.join(screenshotsDir, 'step_3_search_results.png');
    await page.screenshot({ path: step3 });
    screenshots.push(step3);

    // 14. Extract the titles and locations of the first 3 visible listings
    const cards = await page.$$('.listings-grid .listing-card');
    const extractedListings = [];
    for (let i = 0; i < Math.min(3, cards.length); ++i) {
      const card = cards[i];
      const title = await card.$eval('.listing-location', el => el.textContent.trim());
      const price = await card.$eval('.listing-price .amount', el => el.textContent.trim());
      extractedListings.push({ title, price });
    }

    // 15. Click the first listing card (using nth-of-type)
    if (cards.length > 0) {
      await cards[0].click();
      // Wait for modal to appear
      await page.waitForSelector('.modal-content.listing-modal', { timeout: 5000 });
      // Take screenshot of the modal
      const step4 = path.join(screenshotsDir, 'step_4_listing_modal.png');
      await page.screenshot({ path: step4 });
      screenshots.push(step4);

      // Extract modal title and host name
      const modalTitle = await page.locator('.modal-content.listing-modal h1').textContent();
      const hostName = await page.locator('.modal-content.listing-modal .host-section h3').textContent();
      // Close modal
      await page.locator('.modal-content.listing-modal .modal-close').click();
      await page.waitForSelector('.modal-content.listing-modal', { state: 'detached' });

      return {
        success: true,
        action: "Performed search for 'Seoul', set dates and guests, viewed results, opened first listing modal, and extracted listing/host data.",
        extractedData: {
          searchResults: extractedListings,
          modalTitle: modalTitle?.trim(),
          modalHost: hostName?.replace(/^Hosted by\s*/i, '').trim()
        },
        screenshots,
        error: null
      };
    } else {
      return {
        success: false,
        action: "No listings found after search",
        extractedData: {},
        screenshots,
        error: "No listings found for search"
      };
    }
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots,
      error: error.message
    };
  }
}

import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  const screenshots = [];
  try {
    // 1. Navigate to the HTML file and wait for network to be idle
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // 2. Take initial screenshot of the homepage
    const step1 = path.join(screenshotsDir, 'step_1_initial.png');
    await page.screenshot({ path: step1 });
    screenshots.push(step1);

    // 3. Wait for the search bar section using a unique selector (aria-label on input)
    await page.waitForSelector('input[placeholder="Search destinations"]', { timeout: 5000 });

    // 4. Type a location using a different selector (input[placeholder])
    await page.fill('input[placeholder="Search destinations"]', 'Seoul');

    // 5. Set check-in and check-out dates using input[type="date"]:nth-of-type
    const dateInputs = await page.$$('input[type="date"]');
    if (dateInputs.length >= 2) {
      // Set check-in to 7 days from now, check-out to 10 days from now
      const today = new Date();
      const pad = n => n.toString().padStart(2, '0');
      const checkin = new Date(today.getFullYear(), today.getMonth(), today.getDate() + 7);
      const checkout = new Date(today.getFullYear(), today.getMonth(), today.getDate() + 10);
      const checkinStr = `${checkin.getFullYear()}-${pad(checkin.getMonth() + 1)}-${pad(checkin.getDate())}`;
      const checkoutStr = `${checkout.getFullYear()}-${pad(checkout.getMonth() + 1)}-${pad(checkout.getDate())}`;
      await dateInputs[0].fill(checkinStr);
      await dateInputs[1].fill(checkoutStr);
    }

    // 6. Open guest selector using button with text content (using XPath for uniqueness)
    const guestBtn = await page.waitForSelector('//button[contains(.,"Add guests") or contains(.,"guest")]', { timeout: 5000 });
    await guestBtn.click();

    // 7. Increase adults count by 2 using the "Adults" label and following sibling button
    const adultsPlusBtn = await page.waitForSelector('//strong[text()="Adults"]/ancestor::div[contains(@class,"guest-option")]//button[normalize-space()="+"]', { timeout: 3000 });
    await adultsPlusBtn.click();
    await adultsPlusBtn.click();

    // 8. Close guest menu by clicking outside (click on the header logo)
    await page.click('.logo a');

    // 9. Click the search button using its icon (fa-search) for uniqueness
    const searchBtn = await page.waitForSelector('button:has(i.fa-search)', { timeout: 3000 });
    await searchBtn.click();

    // 10. Wait for loading state to appear and disappear
    await page.waitForSelector('#loading', { state: 'visible', timeout: 4000 });
    await page.waitForSelector('#loading', { state: 'hidden', timeout: 8000 });

    // 11. Wait for listings to appear (use grid role for robustness)
    await page.waitForSelector('.listings-grid > .listing-card', { timeout: 7000 });

    // 12. Take screenshot of search results
    const step2 = path.join(screenshotsDir, 'step_2_search_results.png');
    await page.screenshot({ path: step2 });
    screenshots.push(step2);

    // 13. Click on the listing card for "Modern Hanok in Historic Bukchon" using text selector
    const hanokCard = await page.waitForSelector('//div[contains(@class,"listing-card")]//div[contains(text(),"Hanok")]/ancestor::div[contains(@class,"listing-card")]', { timeout: 4000 });
    await hanokCard.click();

    // 14. Wait for the modal to appear (role=dialog)
    await page.waitForSelector('.modal-content[role="dialog"]', { timeout: 5000 });

    // 15. Take screenshot of the listing modal
    const step3 = path.join(screenshotsDir, 'step_3_listing_modal.png');
    await page.screenshot({ path: step3 });
    screenshots.push(step3);

    // 16. Extract listing modal data: title, price, host name, rating, and amenities
    const modalTitle = await page.textContent('.modal-content h1#modal-title');
    const price = await page.textContent('.modal-content .price-amount');
    const hostName = await page.textContent('.modal-content .host-section h3');
    const rating = await page.textContent('.modal-content .listing-rating span');
    // Extract up to 6 amenities
    const amenities = await page.$$eval('.modal-content .amenity-tag', els => els.map(e => e.textContent).slice(0, 6));

    // 17. Close the modal by clicking the close button (fa-times)
    await page.click('.modal-close');

    // 18. Wait for modal to disappear
    await page.waitForSelector('.modal-content[role="dialog"]', { state: 'detached', timeout: 3000 });

    // 19. Extract the titles of the first 3 visible listings in the grid (for verification)
    const resultTitles = await page.$$eval('.listings-grid .listing-card .listing-location', els => els.slice(0, 3).map(e => e.textContent.trim()));

    return {
      success: true,
      action: "Performed search for 'Seoul', set dates/guests, opened Hanok listing modal, extracted details, and verified search results.",
      extractedData: {
        modalTitle: modalTitle?.trim(),
        price: price?.trim(),
        hostName: hostName?.replace(/^Hosted by\s*/, '').trim(),
        rating: rating?.trim(),
        amenities,
        first3ResultTitles: resultTitles
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots,
      error: error.message
    };
  }
}

import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
