    await page.waitForTimeout(1000);
    await page.screenshot({ path: path.join(screenshotsDir, 'step_6_comment_added.png') });
    screenshots.push(path.join(screenshotsDir, 'step_6_comment_added.png'));

    // Extract video information
    const videoTitle = await page.$eval('.video-title', el => el.textContent);
    const channelName = await page.$eval('.channel-name', el => el.textContent);
